package com.kim.sep233.main2;

public class Array {
String name;
int age;

public Array() {
	// TODO Auto-generated constructor stub
}

public Array(String name, int age) {
	super();
	this.name = name;
	this.age = age;
}

public String getName() {
	return name;
}

public void setName(String name) {
	this.name = name;
}

public int getAge() {
	return age;
}

public void setAge(int age) {
	this.age = age;
}


	
	
}
